import React from 'react'
import { View  , TouchableOpacity,StyleSheet
} from 'react-native'


const customButton =() =>
{
    return(
        <TouchableOpacity style={styles1.container}>
            <View >
                 <Text></Text>
            </View>
        </TouchableOpacity>
        
    )
};

export default customButton;

const styles1 = StyleSheet.create({
    container :{
        backgroundColor:'black'

    }


})
